import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const NutritionPage = ({ userId, onLogout }) => {
  const [ingredients, setIngredients] = useState(['']);
  const [nutritionResult, setNutritionResult] = useState(null);
  const [error, setError] = useState(null);
  const [isLoading, setIsLoading] = useState(false);

  const handleIngredientChange = (index, value) => {
    const newIngredients = [...ingredients];
    newIngredients[index] = value;
    setIngredients(newIngredients);
  };

  const addIngredient = () => {
    setIngredients([...ingredients, '']);
  };

  const removeIngredient = (index) => {
    const newIngredients = ingredients.filter((_, i) => i !== index);
    setIngredients(newIngredients);
  };

  const fetchNutritionData = async () => {
    setIsLoading(true);
    setNutritionResult(null);
    setError(null);

    const url = 'https://edamam-edamam-nutrition-analysis.p.rapidapi.com/api/nutrition-details?force=true&beta=true';
    const options = {
      method: 'POST',
      headers: {
        'x-rapidapi-key': 'a466765c53msh018fb07080bc15ep191a73jsn96306fb334ae',
        'x-rapidapi-host': 'edamam-edamam-nutrition-analysis.p.rapidapi.com',
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({
        ingr: ingredients.filter(ing => ing.trim() !== '')
      })
    };

    try {
      const response = await fetch(url, options);
      const result = await response.json();

      // Check if the response contains expected data
      if (response.ok && result) {
        setNutritionResult(result);
      } else {
        throw new Error('Invalid nutrition data received');
      }
    } catch (error) {
      console.error('Nutrition analysis error:', error);
      setError(error.message || 'Failed to analyze nutrition');
    } finally {
      setIsLoading(false);
    }
  };

  // Safe nutrition value extraction
  const getSafeNutrientValue = (nutrients, key, defaultValue = 0) => {
    return nutrients && nutrients[key] 
      ? Math.round(nutrients[key].quantity) 
      : defaultValue;
  };

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <div className="flex justify-between items-center mb-8">
        <h1 className="text-3xl font-bold">Nutrition Analysis</h1>
        <div className="flex space-x-4">
          <Link 
            to="/recommend" 
            className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
          >
            Meal Recommendations
          </Link>
          <button
            onClick={onLogout}
            className="bg-red-500 hover:bg-red-700 text-white font-bold py-2 px-4 rounded"
          >
            Logout
          </button>
        </div>
      </div>

      <div className="max-w-2xl mx-auto bg-white shadow-md rounded px-8 pt-6 pb-8 mb-4">
        <div className="mb-4">
          {ingredients.map((ingredient, index) => (
            <div key={index} className="flex mb-2">
              <input
                type="text"
                value={ingredient}
                onChange={(e) => handleIngredientChange(index, e.target.value)}
                placeholder="Enter ingredient (e.g., 1 apple, 2 tbsp olive oil)"
                className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 mr-2"
              />
              {ingredients.length > 1 && (
                <button
                  type="button"
                  onClick={() => removeIngredient(index)}
                  className="bg-red-500 hover:bg-red-700 text-white font-bold py-2 px-4 rounded"
                >
                  Remove
                </button>
              )}
            </div>
          ))}
        </div>
        <div className="flex space-x-4">
          <button
            onClick={addIngredient}
            className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded"
          >
            Add Ingredient
          </button>
          <button
            onClick={fetchNutritionData}
            disabled={isLoading || ingredients.every(ing => ing.trim() === '')}
            className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded disabled:opacity-50"
          >
            {isLoading ? 'Analyzing...' : 'Analyze Nutrition'}
          </button>
        </div>

        {error && (
          <div className="mt-4 bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded relative" role="alert">
            <strong className="font-bold">Error: </strong>
            <span className="block sm:inline">{error}</span>
          </div>
        )}

        {nutritionResult && (
          <div className="mt-6">
            <h2 className="text-xl font-bold mb-4">Nutrition Details</h2>
            <div className="grid grid-cols-2 gap-4">
              <div>
                <p><strong>Total Calories:</strong> {Math.round(nutritionResult.calories || 0)}</p>
                <p><strong>Total Fat:</strong> {getSafeNutrientValue(nutritionResult.totalNutrients, 'FAT')} g</p>
                <p><strong>Total Protein:</strong> {getSafeNutrientValue(nutritionResult.totalNutrients, 'PROCNT')} g</p>
                <p><strong>Total Carbohydrates:</strong> {getSafeNutrientValue(nutritionResult.totalNutrients, 'CHOCDF')} g</p>
              </div>
              <div>
                <p><strong>Cholesterol:</strong> {getSafeNutrientValue(nutritionResult.totalNutrients, 'CHOLE')} mg</p>
                <p><strong>Sodium:</strong> {getSafeNutrientValue(nutritionResult.totalNutrients, 'NA')} mg</p>
                <p><strong>Sugar:</strong> {getSafeNutrientValue(nutritionResult.totalNutrients, 'SUGAR')} g</p>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default NutritionPage;
